import React from 'react';
import { Button, StyleSheet, Text, View } from 'react-native';

export default function SingleGame() {
    return (
        <View style={styles.questionContainer}>
            <Text style={styles.question}>
                Who is the author of "The Bitcoin Standard"?
            </Text>
            <Button onPress={() => console.log('clicked 1')} title="Saifedean Ammous" />
            <Button onPress={() => console.log('clicked 2')} title="Parker Lewis" />
            <Button onPress={() => console.log('clicked 3')} title="Preston Pysh" />
            <Button onPress={() => console.log('clicked 4')} title="Michael Saylor" />
        </View>
    );
}

const styles = StyleSheet.create({
    questionContainer:{
      border: '1px solid red',
      boxSizing: 'border-box'
    },
    question: {
        textAlign: "center",
        fontWeight: "bold",
        fontSize: "2rem"
    }
  });
